import React from 'react';
import {BrowserRouter as Router, Routes, Route} from 'react-router-dom';
import Map from './Map';
import Login from './Login';


const App: React.FC = () => {
  return (
    // <div className="App">
    //   <Login />
    // </div>
    <Router>
      <div className="App">
        <Routes>
          <Route path="/">
            <Route path="/map" />
          </Route>
          <Route path="/login" element={<Login />} />
          <Route path="/map" element={<Map />} />
        </Routes>

      </div>
    </Router>
  );
}

export default App;
